(544, 'PAP', 'WHEEL', 'DA4819', 'AROCS 4845K', 'ENGINE', '2023-05-25', 1994, 'Yes', 'D', 'Kontaminasi debu (Si, Al) sangat tinggi, kemungkinan berasal dari lingkungan. Ausan logam Cr di atas normal, Fe dan PQ index sangat tinggi, kemungkinan berasal dari Timing Gear, Cam Shaft, Cam follower, Rocker Arm, cross head, FCD Piston atau ductile cust iron, gear oil pump, cylinder liner, Ring Piston. Pelumas telah diganti.', 'Cek air cleaner element. Cek kondisi air cleaner element seal dan clamp. Cek hose elbow, piping dan clamp hose dari air cleaner housing menuju blower side turbocharger, tidak kendor atau crack. Perhatikan kebersihan sampling. Cek exhaust gas colour (visual). Cek abnormal noise. Cek adanya  benda asing dan ausan logam, cutting oil filter. Lakukan Engine performance test Min. 5 parameter. Perpendek interval pergantian pelumas. Resampling 125 jam berikutnya untuk monitoring.', '2023-08-01 00:03:48'),
